A multi-valued measurement is a measurement that is comprised of multiple values. Here is the representation of a three_phase_current measurement that consists of L1, L2 and L3 values, representing the current on each phase: { "three_phase_current": { "L1": 9.5, "L2": 10.3, "L3": 8.8 }
} where the key is the top-level measurement type and value is a JSON object having further key-value pairs representing each aspect of the multi-valued measurement. Only one level of nesting is allowed, meaning the values of the measurement keys at the inner level can only be numeric values. For example, a multi-level measurement as follows is NOT valid: { "three_phase_current": { "phase1": { "L1": 9.5 }, "phase2": { "L2": 10.3 }, "phase3": { "L3": 8.8 } }
} because the values at the second level(phase1, phase2 and phase3) are not numeric values.

