The Cumulocity mapper translates Thin Edge JSON into Cumulocity's JSON via MQTT . The translated messages are published on the topic c8y/measurement/measurements/create from where they are forwarded to Cumulocity. This mapper is launched by the tedge connect c8y command, and stopped by the tedge disconnect c8y command. Example in Thin Edge JSON: { "temperature": 23
} Translated into JSON via MQTT by the Cumulocity mapper: { "type": "ThinEdgeMeasurement", "time": "2021-04-22T17:05:26.958340390+00:00", "temperature": { "temperature": { "value": 23 } }
} You can see the Cumulocity mapper added the three things which are not defined before translation. type is added. time is added. Another hierarchy level is added, as required by the cumulocity data model. String temperature is used as fragment and series. (1) The type is a mandatory field in the Cumulocity's JSON via MQTT manner, therefore, the Cumulocity mapper always adds ThinEdgeMeasurement as a type. This value is not configurable by users. (2) time will be added by the mapper only when it is not specified in a received Thin Edge JSON message . In this case, the mapper uses the device's local timezone. If you want another timezone, specify the time filed in Thin Edge JSON. (3) The mapper uses a measurement name ("temperature" in this example) as both a fragment type and a fragment series in Cumulocity's measurements . After the mapper publishes a message on the topic c8y/measurement/measurements/create, the message will be transferred to the topic measurement/measurements/create by the MQTT bridge .

