The Cumulocity mapper collects measurements not only from the main device but also from child devices. These measurements are collected under the tedge/measurements/<child-id> topics and forwarded to Cumulocity to corresponding child devices created under the thin-edge.io parent device. (<child-id> is your desired child device ID.) The mapper works in the following steps. When the mapper receives a Thin Edge JSON message on the tedge/measurements/<child-id> topic, the mapper sends a request to create a child device under the thin-edge.io parent device. The child device is named after the <child-id> topic name, and the type is thin-edge.io-child. Publish corresponded Cumulocity JSON measurements messages over MQTT. The child device is created on receipt of the very first measurement for that child device. If the incoming Thin Edge JSON message (published on tedge/measurements/child1) is as follows, { "temperature": 23
} it gets translated into JSON via MQTT by the Cumulocity mapper. { "type":"ThinEdgeMeasurement", "externalSource":{ "externalId":"child1", "type":"c8y_Serial" }, "time":"2013-06-22T17:03:14+02:00", "temperature":{ "temperature":{ "value":23 } }
}

