You can represent measurements that are far more complex than the single-valued ones described above using the Thin Edge JSON format. A multi-valued measurement like three_phase_current that consists of L1, L2 and L3 values, representing the current on each phase can be represented as follows: { "three_phase_current": { "L1": 9.5, "L2": 10.3, "L3": 8.8 }
} Here is another complex message consisting of single-valued measurements: temperature and pressure along with a multi-valued coordinate measurement, all sharing a single timestamp captured as time. { "time": "2020-10-15T05:30:47+00:00", "temperature": 25, "current": { "L1": 9.5, "L2": 10.3, "L3": 8.8 }, "pressure": 98
} The time field is not a regular measurement like temperature or pressure but a special reserved field. Refer to Thin Edge JSON Specification for more details on the kinds of telemetry data that can be represented in Thin Edge JSON format and the reserved fields like time used in the above example.
